import React from "react";
import { Link, NavLink } from "react-router-dom";

const NavBar = () => {
    return (
      <header className={styles.navbar}>
        <nav>
          <ul>
            <li>
              <NavLink
                to="/page-one"
                className={(navData) => (navData.isActive ? styles.actives : "")}
              >
                Page One
              </NavLink>
            </li>
            <li>
              <NavLink
                to="/page-two"
                className={(navData) => (navData.isActive ? styles.actives : "")}
              >
                Japanese
              </NavLink>
            </li>
            <li>
              <NavLink
                to="/page-three"
                className={(navData) => (navData.isActive ? styles.actives : "")}
              >
                Page Three
              </NavLink>
            </li>
          </ul>
        </nav>
      </header>
    );
  };

export default NavBar;
